INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (1, 1, 7, "たまには\n協力するのもいいんじゃない？\nあたしも手を貸してあげる", "2015/12/17 15:00:00", 0, 0.0, 7001, "キャル", 0, "2030/12/17 14:59:59", 1, 0.0, 106001, -363.0);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (1, 1, 7, "多くの方と協力して\n戦えるようです\n主さまなら、さぞ\nご活躍なさることでしょう", "2015/12/17 15:00:00", 0, 0.0, 7002, "コッコロ", 0, "2030/12/17 14:59:59", 1, 0.0, 105901, -363.0);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (1, 1, 7, "たくさんの人と一緒に\n協力バトルです！\nがんばりましょう☆", "2015/12/17 15:00:00", 0, 0.0, 7003, "ペコリーヌ", 0, "2030/12/17 14:59:59", 1, 0.0, 105801, -363.0);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (1, 1, 10, "ジュエルを食べ物…\nいえ、貴重品と交換できます！", "2015/12/17 15:00:00", 0, 0.0, 10001, "ペコリーヌ", 0, "2030/12/17 14:59:59", 1, 0.0, 105801, -363.0);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (1, 1, 10, "ジュエルはよく考えて\n使うことね\n無駄遣い厳禁！", "2015/12/17 15:00:00", 0, 0.0, 10002, "キャル", 0, "2030/12/17 14:59:59", 1, 0.0, 106001, -363.0);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (1, 1, 10, "主さまのジュエルで\n貴重な品々を購入できます\nですが、無駄遣いは\n『めっ』でございますよ", "2015/12/17 15:00:00", 0, 0.0, 10003, "コッコロ", 0, "2030/12/17 14:59:59", 1, 0.0, 105901, -363.0);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (1, 1, 10, "ジュエルがあれば\n貴重品と交換できるみたい\n大事に使いましょうね", "2015/12/17 15:00:00", 2104010, 0.0, 10004, "シェフィ", 0, "2030/12/17 14:59:59", 2, 0.0, 106401, -363.0);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (1, 1, 12, "特定の条件を達成すると\n報酬がもらえますよ！\nがんばりましょう♪　", "2015/12/17 15:00:00", 0, 0.0, 12001, "ペコリーヌ", 0, "2030/12/17 14:59:59", 1, 0.0, 105801, -416.5);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (1, 1, 13, "思い出が詰まってるって\nいろいろあったけど\n振り返るのもいいんじゃない？", "2015/12/17 15:00:00", 0, 0.0, 13001, "キャル", 0, "2030/12/17 14:59:59", 1, 0.0, 106001, -363.0);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (1, 1, 13, "主さまとの楽しい日々…\nこちらで何度でも\n思い返しましょう♪", "2015/12/17 15:00:00", 0, 0.0, 13002, "コッコロ", 0, "2030/12/17 14:59:59", 1, 0.0, 105901, -363.0);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (1, 1, 13, "みんなとの大切な思い出が\nたくさん詰まってるのね\n一緒に振り返って、\n心に刻みたいわ", "2015/12/17 15:00:00", 2104010, 0.0, 13003, "シェフィ", 0, "2030/12/17 14:59:59", 2, 0.0, 106401, -363.0);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (1, 1, 13, "女の子との思い出が\nたくさん見られますよ！\nヒューヒュー♪\nモテモテですねー☆", "2015/12/17 15:00:00", 0, 0.0, 13004, "ペコリーヌ", 0, "2030/12/17 14:59:59", 1, 0.0, 105801, -363.0);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (1, 1, 14, "育成に必要なアイテムが\n獲得できるクエストです\nわたくし、主さまのために、\n強くなりますよ", "2015/12/17 15:00:00", 0, 0.0, 14001, "コッコロ", 0, "2030/12/17 14:59:59", 1, 0.0, 105901, -363.0);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (1, 1, 14, "このクエストを攻略すると、\nアイテムが手に入るらしいわ。\nもっと強くなるために、\n一生懸命がんばるわね！", "2015/12/17 15:00:00", 2104010, 0.0, 14002, "シェフィ", 0, "2030/12/17 14:59:59", 2, 0.0, 106401, -363.0);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (1, 1, 14, "このクエストを攻略すれば、\nアイテムがもらえますよ\nたくさん集めて、どんどん\n強くなっちゃいましょう！", "2015/12/17 15:00:00", 0, 0.0, 14003, "ペコリーヌ", 0, "2030/12/17 14:59:59", 1, 0.0, 105801, -363.0);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (1, 1, 14, "クエストを攻略すると、\nアイテムが手に入るんだって\nもらえるものは、\nもらっておきましょ！", "2015/12/17 15:00:00", 0, 0.0, 14004, "キャル", 0, "2030/12/17 14:59:59", 1, 0.0, 106001, -363.0);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (1, 1, 15, "主さま、旅の準備を整えて\nより充実した冒険をいたし\nましょう", "2015/12/17 15:00:00", 0, 0.0, 15001, "コッコロ", 0, "2030/12/17 14:59:59", 1, 0.0, 105901, -470.0);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (1, 1, 16, "ねぇ…クランに加入してみない？\n一人も楽しいけど、みんなと\n一緒も賑やかでいいと思うの", "2015/12/17 15:00:00", 2104010, 0.0, 16001, "シェフィ", 0, "2030/12/17 14:59:59", 2, 0.0, 106401, -363.0);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (1, 1, 16, "クランに加入してみませんか？\nみんなといっしょに冒険した方が、\n楽しいですよ！", "2015/12/17 15:00:00", 0, 0.0, 16002, "ペコリーヌ", 0, "2030/12/17 14:59:59", 1, 0.0, 105801, -363.0);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (1, 1, 16, "クランに入れるらしいわよ\nせっかくだから入ってみたら？\nけっこう楽しいみたいよ♪", "2015/12/17 15:00:00", 0, 0.0, 16003, "キャル", 0, "2030/12/17 14:59:59", 1, 0.0, 106001, -363.0);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (1, 1, 16, "こちらでクランに加入できます\n素敵なクランがたくさんあって、\n目移りしてしまいますね", "2015/12/17 15:00:00", 0, 0.0, 16004, "コッコロ", 0, "2030/12/17 14:59:59", 1, 0.0, 105901, -363.0);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (1, 1, 17, " こちらではクランバトルに\n 参加された仲間のみなさんの\n 活躍を振り返ることができます", "2015/12/17 15:00:00", 0, 0.0, 17002, "コッコロ", 0, "2030/12/17 14:59:59", 1, 0.0, 105901, -363.0);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (1, 1, 25, "模擬戦の戦績もアンタが\n気に入ったものがあれば\n記録しておけるのね", "2015/12/17 15:00:00", 0, 0.0, 17004, "キャル", 0, "2030/12/17 14:59:59", 1, 0.0, 106001, -363.0);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (1, 1, 25, "主さま、今回のクランバトルでの\nご活躍が記録されています\nバトルの参考にいたしましょう", "2015/12/17 15:00:00", 0, 0.0, 17005, "コッコロ", 0, "2030/12/17 14:59:59", 1, 0.0, 105901, -363.0);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (1, 1, 25, "今回のクランバトルの調子は\nどうかしら？\n戦績を見れば、次のバトルに\n活かせるかもしれないわ", "2015/12/17 15:00:00", 2104010, 0.0, 17006, "シェフィ", 0, "2030/12/17 14:59:59", 2, 0.0, 106401, -363.0);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (1, 1, 25, "今回のクランバトルでの戦績を\nおさらいできますよ！\n私にも見せてください☆", "2015/12/17 15:00:00", 0, 0.0, 17007, "ペコリーヌ", 0, "2030/12/17 14:59:59", 1, 0.0, 105801, -363.0);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (1, 1, 18, "ようこそ！\nこちらでは、\nギルドハウスで流れる音楽の\n変更や購入が出来ますよ", "2015/12/17 15:00:00", 0, 0.0, 18001, "カリン", 0, "2030/12/17 14:59:59", 1, 0.0, 190801, -363.0);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (2, 1, 18, "ＢＧＭの変更や購入は、こちらから\nできますよ\n素敵な音楽を、たくさんご用意\nいたしました！", "2015/12/17 15:00:00", 0, 0.0, 18002, "カリン", 0, "2030/12/17 14:59:59", 1, 0.0, 190801, -363.0);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (3, 1, 19, "ギルドハウスの\nＢＧＭを変更できますよ\nあなたの好きな曲、\n私にも聴かせてくださいね", "2015/12/17 15:00:00", 0, 0.0, 19001, "カリン", 0, "2030/12/17 14:59:59", 1, 0.0, 190801, -470.0);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (4, 1, 19, "こちらでは、ＢＧＭの変更が\nできますよ\nどんな曲に変更しますか？\nふふふ、私も楽しみです♪", "2015/12/17 15:00:00", 0, 0.0, 19002, "カリン", 0, "2030/12/17 14:59:59", 1, 0.0, 190801, -470.0);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (5, 1, 20, "こちらでは、ＢＧＭを購入\nすることができますよ\n試聴することもできるので、\nじっくり選んでくださいね", "2015/12/17 15:00:00", 0, 0.0, 20001, "カリン", 0, "2030/12/17 14:59:59", 1, 0.0, 190801, -470.0);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (6, 1, 20, "いらっしゃいませ！\nＢＧＭの購入はこちらです\n素敵な曲がたくさんあって、\n目移りしちゃいますね", "2015/12/17 15:00:00", 0, 0.0, 20002, "カリン", 0, "2030/12/17 14:59:59", 1, 0.0, 190801, -470.0);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (1, 1, 21, "ここで手に入れたアイテムで\n専用装備を作成できるみたいね\nアイテムが集まったら\nさっそく作ってみましょ！", "2015/12/17 15:00:00", 0, 0.0, 21001, "キャル", 0, "2030/12/17 14:59:59", 1, 0.0, 106001, -363.0);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (1, 1, 21, "攻略すると珍しいアイテムが\n手に入りますよ\nこのアイテムで専用装備を\n作成できるようです", "2015/12/17 15:00:00", 0, 0.0, 21002, "コッコロ", 0, "2030/12/17 14:59:59", 1, 0.0, 105901, -363.0);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (1, 1, 21, "専用装備が欲しいなら\nこのクエストに挑戦するといいわ\n集めた素材でもっともっと\n強くなりましょう", "2015/12/17 15:00:00", 2104010, 0.0, 21003, "シェフィ", 0, "2030/12/17 14:59:59", 2, 0.0, 106401, -363.0);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (1, 1, 21, "専用装備の作成に必要な\nアイテムを獲得できますよ\nたくさん集めてどんどん\n強くなりましょう！", "2015/12/17 15:00:00", 0, 0.0, 21004, "ペコリーヌ", 0, "2030/12/17 14:59:59", 1, 0.0, 105801, -363.0);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (1, 1, 22, "投票はこちらです\nあなたが応援したい女の子に\n思いを込めた一票を\nお願いします！", "2015/12/17 15:00:00", 0, 0.0, 22001, "カリン", 0, "2030/12/17 14:59:59", 1, 0.0, 190801, -430.0);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (2, 1, 22, "ようこそ！\nあなたが思いを寄せるのは\nどの女の子ですか？\n応援してあげてくださいね！", "2015/12/17 15:00:00", 0, 0.0, 22002, "カリン", 0, "2030/12/17 14:59:59", 1, 0.0, 190801, -430.0);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (3, 1, 23, "たくさんの投票、\nありがとうございました\n結果発表を楽しみに\n待っていてくださいね！", "2015/12/17 15:00:00", 0, 0.0, 23001, "カリン", 0, "2030/12/17 14:59:59", 1, 0.0, 190801, -430.0);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (4, 1, 23, "ただ今、人気投票の\n集計中です\n結果が出るまでもう少しだけ\nお待ちくださいね", "2015/12/17 15:00:00", 0, 0.0, 23002, "カリン", 0, "2030/12/17 14:59:59", 1, 0.0, 190801, -430.0);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (1, 2, 24, "あなた様が手伝ってくださった\nチョコレートケーキ\n美味しくないはずがありませんわ", "2019/01/31 12:00:00", 0, 8.0, 24001, "エリコ（バレンタイン）", 10011, "2030/12/17 14:59:59", 1, 4.08, 109001, -385.0);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (2, 2, 24, "このような失敗、あなた様が\nするはずありません\nもう一度挑戦してみましょう", "2019/01/31 12:00:00", 0, 8.0, 24002, "エリコ（バレンタイン）", 10011, "2030/12/17 14:59:59", 1, 5.0, 109001, -385.0);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (3, 2, 24, "あなた様のために\n作っているケーキを\nあなた様に手伝っていただく……\nことになるなんて……クスクス", "2019/01/31 12:00:00", 0, 8.0, 24003, "エリコ（バレンタイン）", 10011, "2030/12/17 14:59:59", 1, 10.11, 109001, -385.0);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (4, 2, 24, "あまり気に病む必要はありませんわ\nこれからは私がたっぷりと\n時間をかけて教えて差し上げますから", "2019/01/31 12:00:00", 0, 8.0, 24004, "エリコ（バレンタイン）", 10011, "2030/12/17 14:59:59", 1, 4.0, 109001, -385.0);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (5, 2, 24, "今回は調子が悪かった……のですか？\nあなた様が手伝ってくれたものなら\nわたしはどんなものでも……クスクス", "2019/01/31 12:00:00", 0, 8.0, 24005, "エリコ（バレンタイン）", 10011, "2030/12/17 14:59:59", 1, 6.0, 109001, -385.0);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (6, 1, 24, "あなた様が手がけた\nチョコレートケーキは\n私にとっての宝物……\n侮辱する者は生かしておきませんわ", "2019/01/31 12:00:00", 0, 0.0, 24006, "エリコ（バレンタイン）", 10011, "2030/12/17 14:59:59", 1, 0.0, 109002, 0.0);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (7, 1, 24, "とても素晴らしい出来栄えですわ！\nあなた様にふさわしい\nチョコレートケーキができました", "2019/01/31 12:00:00", 0, 0.0, 24007, "エリコ（バレンタイン）", 10011, "2030/12/17 14:59:59", 1, 0.0, 109002, 0.0);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (8, 1, 24, "私を手伝ってくれたあなた様は\nすでに私の虜……\n甘い世界に誘って差し上げますわ", "2019/01/31 12:00:00", 0, 0.0, 24008, "エリコ（バレンタイン）", 10011, "2030/12/17 14:59:59", 1, 0.0, 109002, 0.0);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (9, 1, 24, "あなた様の愛情\nしかと受け止めました\nこれが……私たちの初めての\n共同作業ですわね……クスクス", "2019/01/31 12:00:00", 0, 0.0, 24009, "エリコ（バレンタイン）", 10011, "2030/12/17 14:59:59", 1, 0.0, 109002, 0.0);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (10, 1, 24, "これは世界一の\nチョコレートケーキですわ\nだって、あなた様が腕によりをかけて\n作ってくださったんですもの", "2019/01/31 12:00:00", 0, 0.0, 24010, "エリコ（バレンタイン）", 10011, "2030/12/17 14:59:59", 1, 0.0, 109002, 0.0);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (1, 2, 24, "上手にできなくて残念だった？\nでも、弟くんの気持ちが嬉しいな\nいつだってお姉ちゃんは\nそばにいるからね♪", "2019/01/31 12:00:00", 0, 8.0, 24011, "シズル（バレンタイン）", 10011, "2030/12/17 14:59:59", 1, 2.12, 109101, -385.0);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (2, 2, 24, "うーん、弟くんには珍しく\n緊張しちゃったのかな？\nもう一度チャレンジしてみる？", "2019/01/31 12:00:00", 0, 8.0, 24012, "シズル（バレンタイン）", 10011, "2030/12/17 14:59:59", 5, 4.19, 109101, -385.0);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (3, 4, 24, "お姉ちゃんのお手伝い、\nよくできました！\nあー、\nまだつまみ食いしちゃダメだぞ！", "2019/01/31 12:00:00", 0, 8.0, 24013, "シズル（バレンタイン）", 10011, "2030/12/17 14:59:59", 2, 2.3, 109101, -385.0);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (4, 1, 24, "見てみて！\nスポンジに綺麗な焼き目がついてるよ\nさっすが弟くんだね！", "2019/01/31 12:00:00", 0, 0.0, 24014, "シズル（バレンタイン）", 10011, "2030/12/17 14:59:59", 1, 0.0, 109102, 0.0);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (5, 2, 24, "まぁまぁ、落ち込まないで\n見た目は……個性的だけど、\n味は絶対美味しいはずだから！", "2019/01/31 12:00:00", 0, 8.0, 24015, "シズル（バレンタイン）", 10011, "2030/12/17 14:59:59", 5, 5.23, 109101, -385.0);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (6, 1, 24, "弟くんみたいな\n可愛いケーキができたよ！\n早く食べてみたいでしょ♪", "2019/01/31 12:00:00", 0, 0.0, 24016, "シズル（バレンタイン）", 10011, "2030/12/17 14:59:59", 1, 0.0, 109102, 0.0);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (7, 2, 24, "あれれ？　弟くん、指に\nチョコレートがくっついてるよ？\nお姉ちゃんが舐めてあげるね、\nはぁむ！", "2019/01/31 12:00:00", 0, 8.0, 24017, "シズル（バレンタイン）", 10011, "2030/12/17 14:59:59", 1, 5.01, 109101, -385.0);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (8, 1, 24, "なかなか上手にできたんじゃない？\nでも弟くんはまだまだできる子！\nお姉ちゃん、信じてるからね", "2019/01/31 12:00:00", 0, 0.0, 24018, "シズル（バレンタイン）", 10011, "2030/12/17 14:59:59", 1, 0.0, 109102, 0.0);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (9, 1, 24, "わぁ～、\nとっても美味しそうにできたね！\n弟くん手慣れてたから\nお姉ちゃん安心して任せられちゃった！", "2019/01/31 12:00:00", 0, 0.0, 24019, "シズル（バレンタイン）", 10011, "2030/12/17 14:59:59", 1, 0.0, 109102, 0.0);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (10, 1, 24, "や～ん、弟くんが手伝ってくれた\nチョコレートケーキ！\nすっごく美味しそうにできたね♪", "2019/01/31 12:00:00", 0, 0.0, 24020, "シズル（バレンタイン）", 10011, "2030/12/17 14:59:59", 1, 0.0, 109102, 0.0);
