INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (1, 1, 42, "訓練の成果に応じて、\n報酬がもらえるそうです。\n共に励んでいきましょう。", "2015/12/17 15:00:00", 0, 0.0, 42001, "コッコロ", 0, "2030/12/17 14:59:59", 1, 0.0, 105901, -416.5);
