INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (1, 1, 42, "腕試しをがんばれば、\n報酬がもらえますよ。\n挑戦していきましょう☆", "2015/12/17 15:00:00", 0, 0.0, 42003, "ペコリーヌ", 0, "2030/12/17 14:59:59", 1, 0.0, 105801, -416.5);
