INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (1, 1, 43, "ここからアリーナに\n挑戦できますよ！\n編成を工夫してライバルに\n挑んじゃいましょう！", "2015/12/17 15:00:00", 0, 0.0, 43001, "ペコリーヌ", 0, "2030/12/17 14:59:59", 1, 0.0, 105801, -363.0);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (1, 1, 43, "こちらからアリーナに\n挑戦することができます。\n主さまらしい編成で\nライバルに挑みましょう。", "2015/12/17 15:00:00", 0, 0.0, 43002, "コッコロ", 0, "2030/12/17 14:59:59", 1, 0.0, 105901, -363.0);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (1, 1, 43, "ここからアリーナに\n挑戦できるわよ！\nしっかり編成を考えて\nライバルに挑みなさい！", "2015/12/17 15:00:00", 0, 0.0, 43003, "キャル", 0, "2030/12/17 14:59:59", 1, 0.0, 106001, -363.0);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (1, 1, 44, "ミッションをクリアすると報酬が\n受け取れるわ。ジャンジャン\nクリアしてバリバリ強化して\nあげなさい♪", "2015/12/17 15:00:00", 0, 0.0, 43004, "アメス", 0, "2030/12/17 14:59:59", 1, 0.0, 123001, -416.5);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (2, 1, 44, "ぼんやりしてる場合じゃないわ。\n早くミッションをクリアして\n報酬を受け取ってきなさい！", "2015/12/17 15:00:00", 0, 0.0, 43005, "アメス", 0, "2030/12/17 14:59:59", 1, 0.0, 123001, -416.5);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (3, 2, 45, "ちょっとあんた、報酬が\n受け取れるじゃない！\n忘れずにチェックなさい。\nアメス様との約束よ？", "2015/12/17 15:00:00", 0, 0.0, 43006, "アメス", 0, "2030/12/17 14:59:59", 1, 5.79, 123001, -416.5);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (1, 1, 46, "はい、お疲れさま。\nここではマスタリーチケットを\n使って、マスタリー強化素材を\n手に入れることができるわよ。", "2015/12/17 15:00:00", 0, 0.0, 46001, "アメス", 0, "2030/12/17 14:59:59", 1, 0.0, 123001, -371.5);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (1, 2, 47, "呼ばれて飛び出てお姉ちゃんだよ♪\nたとえ火の中、水の中、迷宮の中っ\nこのダンジョンを踏破できるよう\n弟くんを応援してあげるからねっ♪", "2015/12/17 15:00:00", 0, 0.0, 47001, "シズル", 0, "2030/12/17 14:59:59", 2, 0.0, 104901, -416.5);
